import React, { Component } from "react";

export default class Formsearch extends Component {
  render() {
    return (
      <div>
          <form class="form-inline d-flex justify-content-center md-form form-sm mt-0">
        <div class="container">
          <div class="row">
            <div class="col col-8">
              <input
                class="form-control form-control-sm ml-3 w-75"
                type="text"
                placeholder="Search"
                aria-label="Search"
              />
            </div>
            
          </div>
        </div>
        </form>
      </div>
    );
  }
}
